Right now, fire fighters are being forced to use pickup trucks to fight fires.

Why? Private equity bought up all of the fire truck manufacturing companies.

@IAFFPresident and I agree — we’ve got to put a stop to this. https://t.co/svc0sMKqdP

JPMorgan kept Jeffrey Epstein as a client for almost 15 years, despite employees raising the alarm.

Americans deserve to know whether big banks enabled Epstein’s horrific crimes – and how to prevent this from happening again.

@BankingGOP should hold a hearing immediately. https://t.co/sNnKqM0CIl

Trump and Republicans got rid of the CFPB's $5 cap on overdraft fees, allowing big banks to keep raking in profits off of struggling Americans.

So just how much money are banks taking from consumers with these predatory fees?

@SenSanders, @SenBlumenthal, and I are finding out. https://t.co/6oNf4dIEL0

It’s on Republic Services to keep our communities clean and return to the negotiating table.

@Teamsters25’s requests are simple: better treatment, fair wages, and stronger labor protections. I’m with them all the way.

When workers fight, workers win.

Right now, defense contractors are slowing down our troops and costing taxpayers big bucks.

They’ve snuck fine print into military contracts that prevents servicemembers from fixing their own equipment when it breaks.

@SenSheehyPress and I are teaming up to put a stop to this. https://t.co/U4TjbYxsOR

Right now, members of the military are being stopped from fixing some of their OWN equipment.

Why? Their contracts say that only CONTRACTORS can make repairs, threatening our security and allowing them to overcharge us by billions.

@SenSheehyPress and I have a bill to fix this.

@RonWyden @SenOssoff @SenLBR @PattyMurray Republicans snuck in a line that'd make it harder for people to become home care workers for seniors and people with disabilities.

@SenatorAndyKim forced a vote to try to take it out.

Republicans voted NO.

@RonWyden @SenOssoff @SenLBR @PattyMurray Get this: Republicans voted NO to protect Medicaid funding for addiction treatment.

If you’re battling addiction, Republicans are happy to throw you under the bus in order to give a billionaire another tax break.

It’s shameful.

@RonWyden @SenOssoff @SenLBR Republicans just voted to DEFUND health clinics and deny women basic health care.

@PattyMurray forced a vote to try and protect that critical funding. 

Republicans voted NO.

@RonWyden @SenOssoff Republicans just voted NO to save funding for labor and delivery rooms for mommas and babies.

@SenLBR asked a simple question: do we stand for billionaires or moms and babies?

Republicans voted with the billionaires and threw mommas and babies under the bus. It’s cruel.

@RonWyden Republicans just voted to RAISE Americans’ health care costs.

@SenOssoff led Democrats in fighting to stop premiums from spiking and bring down costs for working families.

But Republicans said NO — they just want to give tax breaks to billionaires.

Republicans just voted NO to saving health care for MILLIONS of people.

@RonWyden demanded that the Senate remove every single Medicaid cut from this bill because we believe no baby should go hungry so Jeff Bezos can buy another yacht.

Hear that again: Republicans voted NO.

This is extremely disturbing.

@SenAlexPadilla was violently removed from a public briefing for asking questions on behalf of the people he represents.

Every day that goes by, Donald Trump is making our nation look more and more like a fascist state.

When private equity owns your doctor, you pay MORE for WORSE care. Their priority is profit.

@GovTinaKotek just signed into law the strongest protections against corporate profiteering in health care.

Congress should follow and get private equity out of health care nationwide. https://t.co/AsTDhWLrGs

Right now, members of the military can't fix their OWN weapons because giant defense contractors won't let them.

Imagine you're up against an enemy, your equipment breaks, and there's nothing you can do about it. Terrifying.

@SenSheehyPress and I are teaming up to stop this. https://t.co/BluImHjxAR

Egg prices are through the roof—and giant egg producers are raking in record profits.

Working families deserve to know if those sky-high prices are because of out-of-control corporate greed.

@SenatorBanks and I are pressing @TheJusticeDept to get answers.

Fire chiefs across Massachusetts told me their jobs are made harder by private equity hiking up fire truck prices and creating shortages and delays.
 
That makes our firefighters and communities less safe.
 
@SenatorBanks and I opened a bipartisan investigation to get answers.

Giant health insurers and their middlemen jack up drug costs and drive community pharmacies out of business.

@MassAGO and 38 attorneys general just asked Congress to break these giants up.

@HawleyMO and I have a bipartisan bill to do just that. Let’s get it done.

DOGE has seized access to huge troves of sensitive personal and national security information – and can’t even set up its own website securely.

When DOGE fails to protect that data, it puts us all in danger.

@Rep_Stansbury, @GerryConnolly and I are pushing back. https://t.co/p6Rikod6Ng

For years, I’ve called for making high-quality generic drugs here at home so we’re not reliant on foreign countries for access to medication.

@SenTinaSmith and I have a bill to make life-saving drugs in the United States. 

https://t.co/697U0derNR

The Consumer Financial Protection Bureau makes sure you don't get scammed by digital payment companies and car lenders.

Elon Musk’s role as CEO of @XMoney and @Tesla makes DOGE’s takeover of the CFPB a clear conflict of interest.

@SenAdamSchiff and I are pressing for answers.

